var m2a=[{ub:"2006-01-20",heading:"Zaskakuj\u0105ca decyzja \u2013 Google odmawia ujawnienia informacji na wniosek w\u0142adz",content:es("Google odmawia udzielenia informacji na wniosek Departamentu Sprawiedliwo\u015bci, kt\u00f3ry za\u017c\u0105da\u0142 ujawnienia hase\u0142 wpisywanych do wyszukiwarki przez miliony u\u017cytkownik\u00f3w, i argumentuje odmow\u0119 \u201ebrakiem zasadno\u015bci i\u00a0nadmiern\u0105 szczeg\u00f3\u0142owo\u015bci\u0105 wniosku, kt\u00f3rego spe\u0142nienie by\u0142oby uci\u0105\u017cliwe i\u00a0mog\u0142oby zagra\u017ca\u0107 bezpiecze\u0144stwu tajemnic handlowych oraz anonimowo\u015bci u\u017cytkownik\u00f3w\u201d. Wniosek ten jest przypuszczalnie elementem rz\u0105dowego programu egzekwowania ustawy dotycz\u0105cej walki z\u00a0pornografi\u0105 internetow\u0105, a\u00a0jego zasadno\u015b\u0107 opera si\u0119 na ameryka\u0144skiej Ustawie Patriotycznej."),
ei:"PRZECZYTAJ WIADOMO\u015a\u0106 W\u00a0SERWISIE INFORMACYJNYM",Ph:"https://www.nytimes.com/2006/01/20/technology/20google.html"},{ub:"2009-12-21",heading:"Google publikuje post na blogu, w\u00a0kt\u00f3rym definiuje poj\u0119cie otwarto\u015bci.",content:es("Definiuj\u0105c poj\u0119cia \u201esystem\u00f3w otwartych\u201d, \u201eotwartych technologii\u201d oraz \u201eotwartych informacji\u201d, Google nakre\u015bla ideologiczne fundamenty Raportu przejrzysto\u015bci. We fragmencie dotycz\u0105cym przejrzysto\u015bci om\u00f3wiono narz\u0119dzia oraz inne sposoby udost\u0119pniania informacji u\u017cytkownikom. Autor pr\u00f3buje r\u00f3wnie\u017c dociec, w\u00a0jaki spos\u00f3b zwi\u0119kszenie przejrzysto\u015bci przek\u0142ada si\u0119 na wi\u0119ksze zainteresowanie u\u017cytkownik\u00f3w us\u0142ug\u0105."),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://googleblog.blogspot.com/2009/12/meaning-of-open.html"},{ub:"2010-04-20",heading:"Google wprowadza narz\u0119dzie Wnioski urz\u0119dowe.",content:es('\u201eKa\u017cdy cz\u0142owiek ma prawo wolno\u015bci opinii i\u00a0wyra\u017cania jej\u201d \u2013 ten zapis <a href="https://www.un.org/en/universal-declaration-human-rights/index.html">Powszechnej Deklaracji Praw Cz\u0142owieka</a> zainspirowa\u0142 Google do utworzenia narz\u0119dzia Wnioski urz\u0119dowe, kt\u00f3re s\u0142u\u017cy do informowania internaut\u00f3w o\u00a0\u017c\u0105daniach ujawnienia danych na temat u\u017cytkownik\u00f3w lub usuni\u0119cia tre\u015bci na wniosek w\u0142adz. W\u00a0swoim o\u015bwiadczeniu David Drummond napisa\u0142: \u201eMamy nadziej\u0119, \u017ce to narz\u0119dzie rzuci nieco \u015bwiat\u0142a na skal\u0119 oraz zakres wniosk\u00f3w urz\u0119dowych o\u00a0cenzurowanie tre\u015bci i\u00a0przekazanie danych u\u017cytkownik\u00f3w z\u00a0r\u00f3\u017cnych kraj\u00f3w\u201d.'),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://googleblog.blogspot.com/2010/04/greater-transparency-around-government.html"},{ub:"2010-09-21",heading:"Google wprowadza Raport przejrzysto\u015bci.",content:es("Kilka miesi\u0119cy po wprowadzeniu narz\u0119dzia Wnioski urz\u0119dowe Google \u0142\u0105czy je z\u00a0danymi o\u00a0zak\u0142\u00f3ceniach w\u00a0ruchu. Efektem tego po\u0142\u0105czenia jest pierwszy Raport przejrzysto\u015bci \u2013 nowe, interaktywne narz\u0119dzie, kt\u00f3re ukazuje wp\u0142yw polityki na dost\u0119p do informacji i\u00a0zach\u0119ca u\u017cytkownik\u00f3w do dyskusji na temat swobody przep\u0142ywu informacji w\u00a0internecie."),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://googlepublicpolicy.blogspot.com/2010/09/tools-to-visualize-access-to.html"},{ub:"2011-06-27",heading:"Aktualizacja Raportu przejrzysto\u015bci zawiera wa\u017cne informacje na temat wniosk\u00f3w urz\u0119dowych.",content:es("Dzi\u0119ki dodaniu funkcji filtrowania wed\u0142ug kraj\u00f3w ta zbiorcza aktualizacja u\u0142atwia u\u017cytkownikom obserwacj\u0119 trend\u00f3w danych. W\u00a0raportach coraz cz\u0119\u015bciej ujawniane s\u0105 argumenty, na podstawie kt\u00f3rych \u017c\u0105dano od Google usuni\u0119cia tre\u015bci, np. zarzuty o\u00a0znies\u0142awienie czy szerzenie nienawi\u015bci. Ponadto Google po raz pierwszy ujawnia odsetek \u017c\u0105da\u0144 udost\u0119pnienia danych u\u017cytkownik\u00f3w, kt\u00f3re zosta\u0142y spe\u0142nione w\u00a0ca\u0142o\u015bci lub cz\u0119\u015bciowo."),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://googleblog.blogspot.com/2011/06/updated-and-more-detailed-transparency.html"},{ub:"2011-09-27",heading:"Google udost\u0119pnia nieprzetworzone dane, kt\u00f3re wykorzystuje w\u00a0Raporcie przejrzysto\u015bci.",content:es("Dane te mo\u017cna eksportowa\u0107 w\u00a0r\u00f3\u017cnych formatach do odczytu maszynowego. Analitycy i\u00a0naukowcy mog\u0105 je dowolnie wizualizowa\u0107 lub \u0142\u0105czy\u0107 z\u00a0informacjami uzyskanymi od innych organizacji w\u00a0celu testowania i\u00a0wysuwania nowych hipotez."),
ei:"WY\u015aWIETL DANE",Ph:"user-data"},{ub:"2012-05-24",heading:"Google rozszerza Raport przejrzysto\u015bci o\u00a0sekcj\u0119 dotycz\u0105c\u0105 wniosk\u00f3w o\u00a0usuni\u0119cie tre\u015bci naruszaj\u0105cych prawa autorskie.",content:es('Pi\u0119\u0107 miesi\u0119cy po <a href="https://googleblog.blogspot.com/2012/01/dont-censor-web.html">zawieszeniu prac nad ameryka\u0144skimi ustawami PIPA i\u00a0SOPA</a>, w\u00a0wyniku agitacji zainicjowanej przez internaut\u00f3w, nowa funkcja Raportu przejrzysto\u015bci ujawnia liczb\u0119 wniosk\u00f3w, z\u00a0kt\u00f3rymi w\u0142a\u015bciciele praw autorskich wyst\u0105pili do Google, \u017c\u0105daj\u0105c usuni\u0119cia wynik\u00f3w wyszukiwania Google kieruj\u0105cych do tre\u015bci mog\u0105cych narusza\u0107 prawo.')},
{ub:"2012-07-02",heading:"Inne firmy przy\u0142\u0105czaj\u0105 si\u0119 do inicjatywy publikowania raport\u00f3w przejrzysto\u015bci.",content:es('W\u00a0lipcu 2012 roku <a href="https://transparency.twitter.com/">Twitter</a> ujawni\u0142 informacje na temat wp\u0142ywu wniosk\u00f3w urz\u0119dowych na swobod\u0119 dost\u0119pu do informacji w\u00a0internecie. <a href="https://www.microsoft.com/about/csr/transparencyhub/">Microsoft</a>, <a href="https://www.apple.com/privacy/transparency-reports/">Apple</a> i\u00a0<a href="https://govtrequests.facebook.com/about/">Facebook</a> do\u0142\u0105czy\u0142y do tej inicjatywy w\u00a0kolejnym roku, przyczyniaj\u0105c si\u0119 do rozpowszechnienia praktyki ujawniania raport\u00f3w przejrzysto\u015bci.')},
{ub:"2013-03-05",heading:"Google publikuje informacje o tzw. nakazach NSL (National Security Letters) w\u00a0zasobach Raportu przejrzysto\u015bci.",content:es('Na <a href="/user-data/us-national-security">stronie dotycz\u0105cej wniosk\u00f3w o\u00a0przekazanie danych u\u017cytkownik\u00f3w w\u00a0USA</a> Google publikuje najnowsze informacje na temat liczby otrzymywanych nakaz\u00f3w NSL zwi\u0105zanych z\u00a0danymi u\u017cytkownik\u00f3w, a\u00a0tak\u017ce liczby kont obj\u0119tych tymi nakazami.'),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://googleblog.blogspot.com/2013/03/transparency-report-shedding-more-light.html"}],n2a=[{ub:"2013-06-06",heading:"Ameryka\u0144ska Agencja Bezpiecze\u0144stwa Narodowego (NSA) gromadzi zapisy rozm\u00f3w telefonicznych milion\u00f3w obywateli USA.",content:es("Z\u00a0pierwszej partii dokument\u00f3w przekazanych przez Edwarda Snowdena wynika, \u017ce firma Verizon mia\u0142a obowi\u0105zek codziennego przekazywania agencji NSA danych dotycz\u0105cych wszystkich po\u0142\u0105cze\u0144 telefonicznych obs\u0142ugiwanych przez tego operatora. P\u00f3\u017aniejsze ujawnienie zatrwa\u017caj\u0105cych danych na temat monitorowania aktywno\u015bci u\u017cytkownik\u00f3w przez rz\u0105dy r\u00f3\u017cnych kraj\u00f3w \u015bwiata wzmocni znaczenie przejrzysto\u015bci dzia\u0142a\u0144 w internecie."),
ei:"PRZECZYTAJ WIADOMO\u015a\u0106 W\u00a0SERWISIE INFORMACYJNYM",Ph:"https://www.theguardian.com/world/2013/jun/06/nsa-phone-records-verizon-court-order"},{ub:"2013-06-07",heading:"Google odpowiada na zarzuty dotycz\u0105ce przyst\u0105pienia do programu PRISM.",content:es("Larry Page, prezes zarz\u0105du, oraz David Drummond, dyrektor ds. prawnych, zapewnili, \u017ce \u201enie przyst\u0105pili\u015bmy do \u017cadnego programu, w\u00a0ramach kt\u00f3rego rz\u0105d USA ani jakiegokolwiek innego kraju mia\u0142by dost\u0119p do naszych serwer\u00f3w\u201d. W\u00a0po\u015bcie na blogu Google podkre\u015blili istotno\u015b\u0107 zachowania przejrzysto\u015bci oraz znaczenie Raportu przejrzysto\u015bci Google w\u00a0kontek\u015bcie rzekomego uczestnictwa w\u00a0programie PRISM."),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://googleblog.blogspot.com/2013/06/what.html"},{ub:"2013-06-11",heading:"Google zamierza zwi\u0119kszy\u0107 przejrzysto\u015b\u0107 w\u00a0kontek\u015bcie nakaz\u00f3w NSA.",content:es('Pr\u00f3buj\u0105c uzyska\u0107 zgod\u0119 na opublikowanie jeszcze wi\u0119kszej ilo\u015bci danych dotycz\u0105cych nakaz\u00f3w agencji NSA, a\u00a0zw\u0142aszcza ujawnienia informacji na temat <a href="https://en.wikipedia.org/wiki/Foreign_Intelligence_Surveillance_Act">nakaz\u00f3w FISA</a> wysy\u0142anych do u\u017cytkownik\u00f3w, Google wysy\u0142a pismo do prokuratora generalnego oraz FBI, podpisane przez Davida Drummonda, dyrektora ds. prawnych.'),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://googleblog.blogspot.com/2013/06/asking-us-government-to-allow-google-to.html"},{ub:"2013-06-25",heading:"W\u00a0nowej sekcji dotycz\u0105cej bezpiecznego przegl\u0105dania Google publikuje dane dotycz\u0105ce z\u0142o\u015bliwego oprogramowania oraz wy\u0142udzania informacji.",content:es("W\u00a02006\u00a0roku firma Google uruchomi\u0142a Bezpieczne przegl\u0105danie\u00a0\u2013 us\u0142ug\u0119 rozpoznaj\u0105c\u0105 niebezpieczne witryny, kt\u00f3ra ostrzega u\u017cytkownik\u00f3w i\u00a0w\u0142a\u015bcicieli witryn o\u00a0potencjalnych zagro\u017ceniach. W\u00a0czerwcu 2013\u00a0roku Google ujawnia pierwsze dane z\u00a0us\u0142ugi Bezpieczne przegl\u0105danie\u00a0\u2013 mi\u0119dzy innymi statystyki dotycz\u0105ce rozpowszechnienia witryn uznanych za niebezpieczne oraz powiadomie\u0144 wys\u0142anych do u\u017cytkownik\u00f3w. Us\u0142ug\u0119 uzupe\u0142niono p\u00f3\u017aniej o\u00a0narz\u0119dzie do wyszukiwania, dzi\u0119ki kt\u00f3remu u\u017cytkownicy mog\u0105 sprawdzi\u0107 stan danego adresu URL."),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://googleblog.blogspot.com/2013/06/transparency-report-making-web-safer.html"},{ub:"2014-03-20",heading:"Google wprowadza sprawdzanie i\u00a0wysy\u0142anie e-maili wy\u0142\u0105cznie przez szyfrowane po\u0142\u0105czenia HTTPS.",content:es('Google obs\u0142uguje <a href="https://gmail.googleblog.com/2008/07/making-security-easier.html">protok\u00f3\u0142 HTTPS</a> ju\u017c od momentu jego wprowadzenia, a\u00a0od\u00a02010 roku <a href="https://gmail.googleblog.com/2010/01/default-https-access-for-gmail.html">stosuje ten protok\u00f3\u0142 jako domy\u015blny</a>. Ta zmiana zaw\u0119\u017ca obieg korespondencji wy\u0142\u0105cznie do serwer\u00f3w Gmaila i\u00a0jego u\u017cytkownik\u00f3w, chroni\u0105c j\u0105 przed dost\u0119pem innych os\u00f3b.'),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://googleblog.blogspot.com/2014/03/staying-at-forefront-of-email-security.html"},{ub:"2014-05-13",heading:"Trybuna\u0142 Sprawiedliwo\u015bci Unii Europejskiej wydaje orzeczenie b\u0119d\u0105ce kamieniem milowym w\u00a0ochronie prywatno\u015bci.",content:es('Trybuna\u0142 Sprawiedliwo\u015bci Unii Europejskiej wyda\u0142 <a href="https://curia.europa.eu/jcms/upload/docs/application/pdf/2014-05/cp140070en.pdf">orzeczenie</a>, wed\u0142ug kt\u00f3rego ka\u017cda osoba ma prawo do za\u017c\u0105dania usuni\u0119cia z\u00a0wynik\u00f3w wyszukiwania informacji zawieraj\u0105cych jej imi\u0119 i\u00a0nazwisko w\u00a0przypadku, gdy informacje te s\u0105 \u201eniew\u0142a\u015bciwe, (ju\u017c) niestosowne czy te\u017c nadmierne\u201d. W\u00a0przypadku Google oznacza to, \u017ce obywatele Unii Europejskiej maj\u0105 <a href="https://googlepolicyeurope.blogspot.com/2015/07/implementing-european-not-global-right.html">prawo do usuni\u0119cia informacji</a>, czyli wyst\u0105pienia do operatora wyszukiwarki z\u00a0\u017c\u0105daniem usuni\u0119cia z\u00a0wynik\u00f3w wyszukiwania okre\u015blonych link\u00f3w, kt\u00f3re wy\u015bwietlaj\u0105 si\u0119 po wpisaniu imienia i\u00a0nazwiska danej osoby. Kilka miesi\u0119cy p\u00f3\u017aniej Google uzupe\u0142nia Raport przejrzysto\u015bci o\u00a0<a href="/eu-privacy/overview">sekcj\u0119</a> zawieraj\u0105c\u0105 informacje na temat wp\u0142ywu tego orzeczenia.'),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://europe.googleblog.com/2015/07/implementing-european-not-global-right.html"},{ub:"2014-06-03",heading:'Google rozszerza Raport przejrzysto\u015bci o\u00a0sekcj\u0119 dotycz\u0105c\u0105 <a href="/safer-email/overview">bezpieczniejszej poczty</a>.',content:es('Nowa sekcja u\u0142atwi u\u017cytkownikom sprawdzenie, czy ich korespondencja jest szyfrowana. Jednocze\u015bnie Google udost\u0119pnia kod \u017ar\u00f3d\u0142owy rozszerzenia do Chrome o\u00a0nazwie <a href="https://security.googleblog.com/2014/06/making-end-to-end-encryption-easier-to.html">End-to-End</a>, by umo\u017cliwi\u0107 spo\u0142eczno\u015bci u\u017cytkownik\u00f3w oprogramowania typu open source testowanie, ocen\u0119 i\u00a0ulepszanie takiego oprogramowania.'),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://googleblog.blogspot.com/2014/06/transparency-report-protecting-emails.html"},{ub:"2014-09-15",heading:"Przy okazji dziesi\u0105tej aktualizacji Raportu przejrzysto\u015bci Google zauwa\u017ca, \u017ce w\u00a0ci\u0105gu pi\u0119ciu ostatnich lat liczba \u017c\u0105da\u0144 ujawnienia danych u\u017cytkownik\u00f3w na wniosek w\u0142adz wzros\u0142a o\u00a0150%.",content:es('W\u00a0tej aktualizacji Google udost\u0119pnia szczeg\u00f3\u0142owe informacje na temat liczby \u017c\u0105da\u0144 ujawnienia informacji o\u00a0u\u017cytkownikach na wniosek w\u0142adz w\u00a0zwi\u0105zku z\u00a0tocz\u0105cymi si\u0119 \u015bledztwami w\u00a0sprawach kryminalnych. Ta aktualizacja zawiera r\u00f3wnie\u017c \u017c\u0105dania ujawnienia informacji o\u00a0u\u017cytkownikach na podstawie przepis\u00f3w <a href="https://support.google.com/transparencyreport/answer/7380434?ref_topic=7380433/#FISA">ustawy FISA</a> oraz <a href="https://support.google.com/transparencyreport/answer/7380434?ref_topic=7380433/#NSL">nakaz\u00f3w NSL</a>.'),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://publicpolicy.googleblog.com/2014/09/transparency-report-government-demands_15.html"},{ub:"2015-06-01",heading:"Google uruchamia stron\u0119 privacy.google.com.",content:es("Google uruchamia stron\u0119 privacy.google.com, na kt\u00f3rej znajduj\u0105 si\u0119 informacje mi\u0119dzy innymi o\u00a0tym, jak Google wykorzystuje dane o\u00a0u\u017cytkownikach, a\u00a0tak\u017ce jakie dane gromadzi, jak je wykorzystuje i\u00a0jak u\u017cytkownicy mog\u0105 zadba\u0107 o\u00a0bezpiecze\u0144stwo swoich danych."),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://googleblog.blogspot.com/2015/06/privacy-security-tools-improvements.html"},{ub:"2016-03-14",heading:"Google rozszerza Raport przejrzysto\u015bci o\u00a0sekcj\u0119 dotycz\u0105c\u0105 protoko\u0142u HTTPS.",content:es("Podkre\u015blaj\u0105c swoje zaanga\u017cowanie w\u00a0kwestie bezpiecze\u0144stwa, Google rozszerza Raport przejrzysto\u015bci o\u00a0now\u0105 sekcj\u0119 dotycz\u0105c\u0105 protoko\u0142u HTTPS. Zawiera ona dane na temat po\u0142\u0105cze\u0144 przez protok\u00f3\u0142 HTTPS w\u00a0r\u00f3\u017cnych us\u0142ugach Google oraz witrynach internetowych. To narz\u0119dzie zosta\u0142o entuzjastycznie przyj\u0119te przez zwolennik\u00f3w bezpiecze\u0144stwa w\u00a0internecie, kt\u00f3rzy powo\u0142uj\u0105 si\u0119 na zawarte w nim dane, by propagowa\u0107 powszechne stosowanie protoko\u0142u HTTPS."),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://security.googleblog.com/2016/03/securing-web-together_15.html"}],o2a=[{ub:"2017-07-18",heading:"Raport przejrzysto\u015bci zmienia si\u0119 od podstaw.",content:es("Przez dwa lata zespo\u0142y Google pracowa\u0142y nad scaleniem oddzielnych sekcji Raportu przejrzysto\u015bci w\u00a0jednolit\u0105 platform\u0119 o\u00a0sp\u00f3jnej budowie. Niekt\u00f3re prace skupia\u0142y si\u0119 na sposobach zapewnienia wi\u0119kszej ilo\u015bci danych i\u00a0umieszczenia ich w\u00a0odpowiednim kontek\u015bcie. Nowa ods\u0142ona Raportu przejrzysto\u015bci jest ukoronowaniem wysi\u0142k\u00f3w pracownik\u00f3w Google, kt\u00f3rzy przez ostatnich 7\u00a0lat pracowali na rzecz zapewnienia przejrzysto\u015bci, i\u00a0toruje drog\u0119 przysz\u0142ym inicjatywom w\u00a0tym obszarze.")},
{ub:"2018-02-26",heading:"Wi\u0119ksza przejrzysto\u015b\u0107 dzia\u0142a\u0144 podejmowanych w\u00a0zwi\u0105zku z\u00a0\u201eprawem do bycia zapomnianym\u201d",content:es('26\u00a0lutego 2018\u00a0roku rozszerzyli\u015bmy raport \u201eUsuwanie wynik\u00f3w wyszukiwania zgodnie z europejskim prawem dotycz\u0105cym prywatno\u015bci\u201d (zwi\u0105zany z\u00a0tak zwanym \u201eprawem do bycia zapomnianym\u201d) o\u00a0dane na temat rodzaj\u00f3w tre\u015bci i\u00a0witryn, kt\u00f3rych dotyczy\u0142y pro\u015bby os\u00f3b o\u00a0usuni\u0119cie z\u00a0wynik\u00f3w wyszukiwania. Dodatkowe dane zacz\u0119li\u015bmy gromadzi\u0107 w\u00a0styczniu 2016\u00a0roku. To wtedy nasi weryfikatorzy zacz\u0119li r\u0119cznie opisywa\u0107 wszystkie usuwane adresy URL, co umo\u017cliwi\u0142o nam \u015bledzenie rodzaj\u00f3w pr\u00f3\u015bb o\u00a0usuni\u0119cie. W\u00a0tym okresie opublikowali\u015bmy tak\u017ce przygotowany przez nas artyku\u0142 \u201e<a href="https://g.co/research/rtbf_report">Three Years of the Right to be Forgotten</a>\u201d (Trzy lata funkcjonowania prawa do bycia zapomnianym), kt\u00f3ry zawiera\u0142 analiz\u0119 tych samych danych. Naszym celem by\u0142o przedstawienie sytuacji w\u00a0obliczu tocz\u0105cej si\u0119 dyskusji na temat zale\u017cno\u015bci mi\u0119dzy prawem do prywatno\u015bci a\u00a0publicznym dost\u0119pem do informacji w\u00a0internecie.'),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://www.blog.google/topics/google-europe/updating-our-right-be-forgotten-transparency-report/"},{ub:"2018-04-23",heading:"Egzekwowanie zgodno\u015bci z\u00a0wytycznymi dla spo\u0142eczno\u015bci YouTube",content:es("W\u00a0dniu 23\u00a0kwietnia 2018\u00a0r. opublikowali\u015bmy nasz pierwszy kwartalny raport na temat egzekwowania zgodno\u015bci z\u00a0wytycznymi dla spo\u0142eczno\u015bci YouTube, kt\u00f3ry zawiera dane dotycz\u0105ce czwartego kwarta\u0142u 2017\u00a0r. Udost\u0119pnili\u015bmy w\u00a0nim dane zbiorcze na temat dzia\u0142a\u0144, kt\u00f3re wykonali\u015bmy w\u00a0celu usuni\u0119cia tre\u015bci naruszaj\u0105cych wytyczne dla spo\u0142eczno\u015bci YouTube. Raport ten zawiera r\u00f3wnie\u017c statystyki dotycz\u0105ce sposob\u00f3w, w\u00a0jakie wykorzystujemy informacje uzyskane za pomoc\u0105 algorytm\u00f3w oraz od os\u00f3b zg\u0142aszaj\u0105cych, by egzekwowa\u0107 nasze zasady na du\u017c\u0105 skal\u0119."),
ei:"PRZECZYTAJ POST NA BLOGU",Ph:"https://youtube.googleblog.com/2018/04/more-information-faster-removals-more.html"},{ub:"2018-07-26",heading:"Nowe wymaganie prawne",content:es("Pierwszego pa\u017adziernika 2017\u00a0r. wesz\u0142a w\u00a0 \u017cycie niemiecka ustawa o\u00a0poprawie egzekwowania prawa w\u00a0serwisach spo\u0142eczno\u015bciowych (\u201eNetzdurchsetzunggesetz\u201d, NetzDG). Okre\u015bla ona wymagania dotycz\u0105ce usuwania nielegalnych tre\u015bci z\u00a0sieci spo\u0142eczno\u015bciowych, kt\u00f3re maj\u0105 w\u00a0Niemczech ponad dwa miliony zarejestrowanych u\u017cytkownik\u00f3w, oraz czas rozpatrzenia zg\u0142osze\u0144 tre\u015bci do usuni\u0119cia. Definicje nielegalnych tre\u015bci podane w\u00a0ustawie NetzDG bazuj\u0105 na odniesieniach do 22\u00a0akt\u00f3w prawnych, a\u00a0operatorzy us\u0142ug, kt\u00f3rych dotyczy ustawa, s\u0105 zobowi\u0105zani dostarcza\u0107 co sze\u015b\u0107 miesi\u0119cy raport dotycz\u0105cy usuni\u0119tych zgodnie z\u00a0ni\u0105 tre\u015bci. Dwudziestego sz\u00f3stego lipca 2018\u00a0r. opublikowali\u015bmy nasz pierwszy raport NetzDG."),
ei:"PRZECZYTAJ POST NA BLOGU PO NIEMIECKU",Ph:"https://germany.googleblog.com/2018/07/update-netzdg.html"},{ub:"2018-08-15",heading:"Dbanie o\u00a0uczciwo\u015b\u0107 wybor\u00f3w przez zapewnienie wi\u0119kszej przejrzysto\u015bci reklam",content:es('Podczas serii przes\u0142ucha\u0144 przed Kongresem Stan\u00f3w Zjednoczonych, do kt\u00f3rych dosz\u0142o pod koniec 2016\u00a0r., zadeklarowali\u015bmy <a href="https://storage.googleapis.com/gweb-uniblog-publish-prod/documents/google_US2016election_work_going_forward_1_WPKcAUQ.pdf">wywi\u0105zanie si\u0119 z\u00a0czterech zobowi\u0105za\u0144</a> zwi\u0105zanych z\u00a0zachowaniem przejrzysto\u015bci i\u00a0rozliczalno\u015bci reklam wyborczych. Pi\u0119tnastego sierpnia 2018\u00a0r., wraz z\u00a0publikacj\u0105 pierwszego w\u00a0naszej historii raportu przejrzysto\u015bci dotycz\u0105cego reklam wyborczych \u201eReklamy polityczne w\u00a0Google\u201d oraz zwi\u0105zanej z\u00a0nim biblioteki kreacji, uda\u0142o si\u0119 nam wywi\u0105za\u0107 z\u00a0ostatnich dw\u00f3ch z\u00a0tych zobowi\u0105za\u0144.')}],
p2a=[["Konieczno\u015b\u0107 zachowania przejrzysto\u015bci","Przed opublikowaniem pierwszego w\u00a0historii internetu Raportu przejrzysto\u015bci dost\u0119pnego w\u00a0wersji online w\u0142adze zwraca\u0142y si\u0119 do nas z\u00a0wnioskami o\u00a0ujawnienie wyczerpuj\u0105cych informacji o\u00a0u\u017cytkownikach. Byli\u015bmy jedn\u0105 z\u00a0niewielu firm, kt\u00f3re odmawia\u0142y udzielenia takich informacji w\u0142adzom.","2006","2013",m2a],["Zwi\u0119kszanie \u015bwiadomo\u015bci","Bezpiecze\u0144stwo internetowe oraz \u015bledzenie aktywno\u015bci w\u00a0internecie s\u0105 obecnie jednymi z\u00a0najwa\u017cniejszych zagadnie\u0144 w\u00a0kontek\u015bcie ujawnienia danych przez Edwarda Snowdena, s\u0142ynnego ataku hakerskiego na firm\u0119 Sony czy obecnych dyskusji na temat szyfrowania danych.",
"2013","2017",n2a],["Rozw\u00f3j poj\u0119cia przejrzysto\u015bci","Rozw\u00f3j poj\u0119cia przejrzysto\u015bci idzie w\u00a0parze z\u00a0rozwojem internetu i\u00a0technologii. Ewolucja Raportu przejrzysto\u015bci Google jest fundamentem dla przysz\u0142ego publikowania jeszcze wi\u0119kszej ilo\u015bci danych.","2017","obecnie",o2a]];
