var TZ=function(a,b){this.store=a;this.Fa=b;this.yk=_.CQ;this.Gc=_.ER;this.fe={hc:"\u017b\u0105dania usuni\u0119cia tre\u015bci sk\u0142adane przez w\u0142adze pa\u0144stwowe",DF:"S\u0105dy i\u00a0instytucje pa\u0144stwowe z\u00a0ca\u0142ego \u015bwiata regularnie przesy\u0142aj\u0105 do nas wnioski o\u00a0usuni\u0119cie informacji z\u00a0us\u0142ug Google. Uwa\u017cnie analizujemy te wnioski i\u00a0sprawdzamy, czy tre\u015bci naruszaj\u0105 prawo lub nasze zasady i\u00a0powinny zosta\u0107 usuni\u0119te. W\u00a0tym raporcie ujawniamy liczb\u0119 wniosk\u00f3w, kt\u00f3re otrzymujemy, z\u00a0podzia\u0142em na 6-miesi\u0119czne okresy raportowania.",
bYa:"Jak s\u0105 sk\u0142adane wnioski urz\u0119dowe",aYa:"\u017b\u0105dania usuni\u0119cia tre\u015bci docieraj\u0105 do nas r\u00f3\u017cnymi drogami i\u00a0pochodz\u0105 ze wszystkich poziom\u00f3w administracji pa\u0144stwowej. S\u0105 to na przyk\u0142ad orzeczenia s\u0105dowe czy pisemne wnioski przesy\u0142ane przez pa\u0144stwowe i\u00a0lokalne instytucje oraz funkcjonariuszy organ\u00f3w \u015bcigania. Czasami u\u017cytkownicy przekazuj\u0105 nam \u017c\u0105dania usuni\u0119cia tre\u015bci pochodz\u0105ce od instytucji pa\u0144stwowych, np. kto\u015b przesy\u0142a nam orzeczenie s\u0105dowe, kt\u00f3re wskazuje, \u017ce pewne tre\u015bci s\u0105 nielegalne. Cz\u0119\u015b\u0107 \u017c\u0105da\u0144 dotyczy usuni\u0119cia wi\u0119kszej liczby materia\u0142\u00f3w. Zdarza si\u0119 te\u017c, \u017ce kilka \u017c\u0105da\u0144 dotyczy usuni\u0119cia tej samej tre\u015bci.",
IVa:"Ocenianie \u017c\u0105da\u0144",HVa:"Zawsze sprawdzamy zasadno\u015b\u0107 i\u00a0kompletno\u015b\u0107 \u017c\u0105da\u0144 instytucji pa\u0144stwowych. Aby\u015bmy mogli w\u0142a\u015bciwie je oceni\u0107, musz\u0105 one zosta\u0107 z\u0142o\u017cone na pi\u015bmie oraz mo\u017cliwie dok\u0142adnie wskazywa\u0107 tre\u015bci do usuni\u0119cia i\u00a0wyja\u015bnia\u0107, dlaczego te tre\u015bci \u0142ami\u0105 przepisy. Uwzgl\u0119dniamy tylko wnioski, kt\u00f3re trafi\u0142y do nas odpowiednimi kana\u0142ami. Je\u015bli otrzymamy ustn\u0105 pro\u015bb\u0119, poprosimy o\u00a0przedstawienie jej na pi\u015bmie.",
tUa:"Orzeczenia s\u0105dowe",sUa:"Analizujemy orzeczenia s\u0105dowe w\u00a0wielu r\u00f3\u017cnych sytuacjach. Czasem orzeczenie nak\u0142ada na nas zobowi\u0105zania. Rozpatrujemy takie orzeczenie, aby ustali\u0107 nasze zobowi\u0105zania i\u00a0zdecydowa\u0107, czy b\u0119dziemy si\u0119 odwo\u0142ywa\u0107. Czasem te\u017c dobrowolnie podejmujemy dzia\u0142ania na podstawie orzecze\u0144, kt\u00f3re nie s\u0105 skierowane bezpo\u015brednio do nas, uznaj\u0105c w\u0142a\u015bciwo\u015b\u0107 s\u0105du do orzekania, czy dany materia\u0142 jest nielegalny wed\u0142ug prawa miejscowego. Mo\u017cemy te\u017c wykorzysta\u0107 orzeczenie s\u0105du, kt\u00f3re nie uznaje bezpo\u015brednio materia\u0142u za nielegalny, do analizy zg\u0142oszenia\u00a0\u2013 na przyk\u0142ad jeste\u015bmy sk\u0142onni do usuwania link\u00f3w do materia\u0142\u00f3w uznanych przez s\u0105d za fa\u0142szywe, w\u00a0tym w\u00a0pewnych przypadkach w\u00a0jurysdykcjach, kt\u00f3rych nie dotyczy pierwotne orzeczenie. Sprawdzamy autentyczno\u015b\u0107 ka\u017cdego otrzymanego dokumentu. Je\u015bli stwierdzimy, \u017ce orzeczenie s\u0105dowe zosta\u0142o sfa\u0142szowane, nie zastosujemy si\u0119 do jego postanowie\u0144. Sprawdzamy te\u017c zakres zastosowania wszystkich otrzymanych dokument\u00f3w. Przedstawione jako uzasadnienie roszczenia orzeczenia s\u0105dowe, kt\u00f3re nie s\u0105 zwi\u0105zane z\u00a0usuni\u0119ciem tre\u015bci, nie zobowi\u0105zuj\u0105 Google do podejmowania \u017cadnych dzia\u0142a\u0144.",
U0a:"Powody, dla kt\u00f3rych nie usuwamy tre\u015bci",T0a:"Istnieje wiele r\u00f3\u017cnych powod\u00f3w, dla kt\u00f3rych mo\u017cemy odm\u00f3wi\u0107 usuni\u0119cia tre\u015bci. Niekiedy \u017c\u0105dania mog\u0105 na przyk\u0142ad nie do\u015b\u0107 dok\u0142adnie wskazywa\u0107 tre\u015bci, kt\u00f3rych usuni\u0119cia domagaj\u0105 si\u0119 instytucje pa\u0144stwowe. Prosimy wtedy o\u00a0wi\u0119cej informacji. Zdarza si\u0119 te\u017c, \u017ce tre\u015bci zosta\u0142y ju\u017c usuni\u0119te przez ich w\u0142a\u015bciciela i\u00a0nie musimy nic wi\u0119cej robi\u0107. Czasami jeste\u015bmy nawet wzywani do usuni\u0119cia tre\u015bci \u201ez\u00a0internetu\u201d.",
GWa:"Usuni\u0119cia zwi\u0105zane z\u00a0naruszeniem zasad Google",FWa:"Dane uwzgl\u0119dnione w\u00a0tym raporcie nie obejmuj\u0105 standardowych \u017c\u0105da\u0144 usuni\u0119cia tre\u015bci, kt\u00f3rymi zajmujemy si\u0119 codziennie na pro\u015bb\u0119 u\u017cytkownik\u00f3w niewyst\u0119puj\u0105cych w\u00a0imieniu instytucji pa\u0144stwowych. Te zg\u0142oszenia mog\u0105 wskazywa\u0107 na naruszenia naszej polityki tre\u015bci lub wytycznych dla spo\u0142eczno\u015bci. Na przyk\u0142ad nie zezwalamy na szerzenie nienawi\u015bci w\u00a0Bloggerze i\u00a0innych podobnych us\u0142ugach.",
DTa:"Kategoryzacja \u017c\u0105da\u0144",CTa:"Przekazuj\u0105c \u017c\u0105danie usuni\u0119cia tre\u015bci, czy to za pomoc\u0105 naszych oficjalnych formularzy internetowych, czy nieformalnie innymi kana\u0142ami (np. za po\u015brednictwem zespo\u0142u ds. polityki publicznej), osoba zg\u0142aszaj\u0105ca okre\u015bla pow\u00f3d zg\u0142oszenia. Niekt\u00f3re \u017c\u0105dania mog\u0105 wskazywa\u0107 na naruszenie praw w\u0142asno\u015bci intelektualnej, a\u00a0inne na z\u0142amanie lokalnych przepis\u00f3w zabraniaj\u0105cych r\u00f3\u017cnych rodzaj\u00f3w tre\u015bci na przyk\u0142ad z\u00a0powodu ich znies\u0142awiaj\u0105cego charakteru. Gdy otrzymujemy skargi dotycz\u0105ce tre\u015bci na naszych platformach, starannie analizujemy te zg\u0142oszenia, aby dopilnowa\u0107, \u017ce zostan\u0105 poprawnie skategoryzowane.",
h1a:"Usuni\u0119cie a\u00a0zablokowanie",g1a:"Niekt\u00f3re rz\u0105dy i\u00a0instytucje pa\u0144stwowe blokuj\u0105 okre\u015blone us\u0142ugi w\u00a0celu kontrolowania dost\u0119pu do tre\u015bci w\u00a0swojej jurysdykcji. Raportowane przez nas statystyki \u017c\u0105da\u0144 usuni\u0119cia tre\u015bci nie obejmuj\u0105 danych na temat takich blokad. Informacje o\u00a0tym, kiedy us\u0142ugi Google by\u0142y niedost\u0119pne, mo\u017cna znale\u017a\u0107 na naszych wykresach nat\u0119\u017cenia ruchu."}};
