var Ms=[{kb:0,type:0,text:"Teledysk przedstawiaj\u0105cy nagiego m\u0119\u017cczyzn\u0119 wychodz\u0105cego z\u00a0oceanu zosta\u0142 kilkakrotnie zg\u0142oszony w\u00a0zwi\u0105zku z\u00a0niezgodnym z\u00a0prawem prezentowaniem tre\u015bci erotycznych."},{kb:0,type:0,text:"Przem\u00f3wienie Angeli Merkel z\u00a0rozwa\u017caniami na temat przynale\u017cno\u015bci islamu do kultury niemieckiej zg\u0142aszano z\u00a0powodu rzekomego szerzenia nienawi\u015bci, a\u00a0tak\u017ce jako tre\u015bci o\u00a0charakterze terrorystycznym, poniewa\u017c zdaniem os\u00f3b zg\u0142aszaj\u0105cych Angela Merkel nara\u017ca kraj na niebezpiecze\u0144stwo i\u00a0prowadzi Niemcy w\u00a0stron\u0119 katastrofy."},
{kb:0,type:0,text:"Film Jana B\u00f6hmermanna, w\u00a0kt\u00f3rym poddaje on krytycznej i\u00a0satyrycznej dyskusji skrajnie prawicow\u0105 grup\u0119, zosta\u0142 zg\u0142oszony kilkakrotnie pod zarzutem szerzenia nienawi\u015bci, przemocy, spamu, znies\u0142awienia oraz zniewa\u017cania."},{kb:0,type:0,text:"Komentarz zachwalaj\u0105cy\u00a0\u201eprzytulanie w\u00a0zaciszu domowym\u201d zg\u0142oszono w\u00a0kategorii \u201edzia\u0142ania szkodliwe lub niebezpieczne\u201d."},{kb:0,type:1,text:"Film pokazuj\u0105cy znanego niemieckiego ekstremist\u0119 islamskiego wzywaj\u0105cego na modlitw\u0119 \u201edua\u201d i\u00a0rytua\u0142 \u201etawaf\u201d, gdzie w\u00a0tle s\u0142ycha\u0107 nawo\u0142ywania \u201etakbir\u201d, zosta\u0142 wielokrotnie zg\u0142oszony na podstawie ustawy NetzDG jako tre\u015bci o\u00a0charakterze terrorystycznym. Jednak poniewa\u017c perspektywa dzia\u0142alno\u015bci misyjnej da\u2019wa pozwala r\u00f3wnie\u017c zinterpretowa\u0107 ten materia\u0142 inaczej ni\u017c jako propagandowy, po zasi\u0119gni\u0119ciu zewn\u0119trznej opinii film uznano za zgodny z\u00a0prawem."},
{kb:0,type:1,text:"Film pokazuj\u0105cy bro\u0144 i\u00a0zupe\u0142nie rozmyte kszta\u0142ty zw\u0142ok poza\u00a0stref\u0105 obj\u0119t\u0105 dzia\u0142aniami wojennymi, w\u00a0prawym rogu widoczny akronim \u201eYPG\u201d. Zewn\u0119trzny doradca nie dopatrzy\u0142 si\u0119 oznak niezgodno\u015bci z\u00a0prawem ani charakteru propagandowego."},{kb:0,type:1,text:"Film przedstawiaj\u0105cy wykonanie kilku pierwszych sekund zakazanej w\u00a0Niemczech \u201ePie\u015bni Horsta Wessela\u201d oraz wyst\u0105pienia parlamentarne polityk\u00f3w nale\u017c\u0105cych do partii AfD. Zewn\u0119trzna komisja uzna\u0142a to za wykorzystanie prawnie zakazanych symboli."},
{kb:0,type:2,text:"Film z\u00a0historycznego przem\u00f3wienia antysemickiego przes\u0142any przez rabina w\u00a0celu przedstawienia i\u00a0skrytykowania tego rodzaju pogl\u0105d\u00f3w prawdopodobnie by\u0142by dozwolony w\u00a0\u015bwietle naszych globalnych zasad. Kontekst mo\u017cemy rozpozna\u0107 dzi\u0119ki opisowi filmu oraz innym tre\u015bciom publikowanym na kanale tw\u00f3rcy. Jednak ten sam materia\u0142 przes\u0142any jako gloryfikuj\u0105cy lub popularyzuj\u0105cy takie pogl\u0105dy prawdopodobnie narusza\u0142by zasady i\u00a0zosta\u0142by usuni\u0119ty."},
{kb:0,type:2,text:"Film z\u00a0ataku terrorystycznego mo\u017ce stanowi\u0107 materia\u0142 informacyjny, je\u015bli zostanie przes\u0142any przez redakcj\u0119 prasow\u0105 lub dziennikarza, ale ten sam klip wideo m\u00f3g\u0142by by\u0107 wykorzystywany do rekrutacji, gdyby zosta\u0142 przes\u0142any przez dan\u0105 organizacj\u0119 terrorystyczn\u0105 w\u00a0celu gloryfikacji wydarzenia lub rekrutacji. Materia\u0142y informacyjne b\u0119d\u0105 prawdopodobnie dozwolone w\u00a0\u015bwietle globalnych zasad, ale rekrutacja do organizacji terrorystycznych narusza nasze zasady i\u00a0filmy tak ocenione prawdopodobnie zostan\u0105 usuni\u0119te."},
{kb:0,type:3,text:"Filmy edukacyjne i\u00a0informacyjne dla pacjentek po mastektomii s\u0105 popularne w\u00a0YouTube. Cz\u0119sto zawieraj\u0105 informacje o\u00a0procedurach i\u00a0technikach dbania o\u00a0siebie po operacji. W\u00a0niekt\u00f3rych pokazane s\u0105 ods\u0142oni\u0119te piersi lub grafiki na temat zabiegu, ale takie filmy s\u0105 dozwolone, poniewa\u017c maj\u0105 charakter edukacyjny."},{kb:0,type:3,text:"W\u00a0YouTube znajduj\u0105 si\u0119 filmy dokumentuj\u0105ce re\u017cim nazistowski w\u00a0Niemczech i\u00a0\u017cycie Hitlera. Materia\u0142y te zawieraj\u0105 np. symbole, kt\u00f3re w\u00a0innych okoliczno\u015bciach s\u0105 w\u00a0Niemczech niedozwolone. Omawiane filmy nie s\u0105 jednak niezgodne z\u00a0prawem ze wzgl\u0119du na sw\u00f3j dokumentacyjny charakter."},
{kb:0,type:3,text:"Chocia\u017c zakazujemy publikowania tre\u015bci, kt\u00f3rych celem jest szokowanie lub budzenie obrzydzenia, wyj\u0105tek stanowi\u0105 tre\u015bci naukowe, kt\u00f3rych g\u0142\u00f3wnym przeznaczeniem jest edukowanie widz\u00f3w. U\u017cytkownicy mog\u0105 mie\u0107 trudno\u015bci z\u00a0ogl\u0105daniem np. sekcji zwierz\u0105t, ale je\u015bli dost\u0119pny jest komentarz chirurga weterynaryjnego lub eksperta, film pozostanie na platformie."},{kb:0,type:3,text:"Niemiecki kolektyw artyst\u00f3w i\u00a0aktywist\u00f3w tworzy przewrotne pokazy, kt\u00f3rych celem jest zach\u0119cenie spo\u0142ecze\u0144stwa obywatelskiego do bardziej odwa\u017cnych kampanii. Kolektyw wielokrotnie pos\u0142ugiwa\u0142 si\u0119 nieprawdziwymi danymi osobowymi, okre\u015blaj\u0105c to jako akt niepos\u0142usze\u0144stwa obywatelskiego. W\u00a0niekt\u00f3rych filmach kolektywu wyst\u0119puj\u0105 wezwania do dzia\u0142a\u0144 niezgodnych z\u00a0prawem i\u00a0przypadki ukrywania to\u017csamo\u015bci, wi\u0119c tego rodzaju tre\u015bci w\u00a0normalnych okoliczno\u015bciach narusza\u0142yby globalne wytyczne dla spo\u0142eczno\u015bci YouTube, jednak w\u00a0kontek\u015bcie artystycznym materia\u0142 pozosta\u0142 dost\u0119pny."},
{kb:0,type:4,text:"Firma z\u0142o\u017cy\u0142a skarg\u0119 w\u00a0zwi\u0105zku z\u00a0zarzutem znies\u0142awienia, zg\u0142aszaj\u0105c film zarejestrowany przez m\u0142odych tw\u00f3rc\u00f3w krytykuj\u0105cych siedzib\u0119 firmy i\u00a0por\u00f3wnuj\u0105cych j\u0105 z\u00a0konkurencj\u0105. Przedmiotem dyskusji by\u0142a cena, wyposa\u017cenie oraz rozmiar siedziby. Firma twierdzi\u0142a, \u017ce podane informacje by\u0142y nieprawdziwe."},{kb:0,type:4,text:"Dyrektor zarz\u0105dzaj\u0105cy firmy z\u0142o\u017cy\u0142 skarg\u0119 w\u00a0zwi\u0105zku ze znies\u0142awieniem, zg\u0142aszaj\u0105c kilka film\u00f3w oskar\u017caj\u0105cych jego oraz firm\u0119 o\u00a0oszustwa. Insynuacje dotycz\u0105 przede wszystkim fa\u0142szowania pozytywnych opinii online oraz posiadania podejrzanych stron internetowych. Dyrekcja twierdzi, \u017ce te informacje s\u0105 nieprawdziwe."},
{kb:0,type:4,text:"Otrzymali\u015bmy wiele skarg w\u00a0zwi\u0105zku ze zniewa\u017ceniem os\u00f3b trzecich, szczeg\u00f3lnie w\u00a0grach i wideoklipach. Okre\u015blenia takie jak \u201ebezczelny\u201d \u201earogancki\u201d lub \u201enatr\u0119tny\u201d zosta\u0142y zg\u0142oszone jako niezgodne z\u00a0prawem zniewagi."},{kb:1,type:0,text:"W filmie z\u00a0fragmentami raportu z\u00a0medi\u00f3w publicznych krytykowano islam i\u00a0nazywano t\u0119 religi\u0119 niebezpieczn\u0105. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:1,type:0,text:"Film prywatnego nadawcy na temat trend\u00f3w dotycz\u0105cych bikini zosta\u0142 zg\u0142oszony w\u00a0zwi\u0105zku z\u00a0rzekomym prezentowaniem tre\u015bci erotycznych. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:1,type:0,text:"Zosta\u0142 zg\u0142oszony film wzywaj\u0105cy do publicznego protestu wobec systemu politycznego w\u00a0Niemczech. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:1,type:1,text:"Film przedstawiaj\u0105cy publiczne wyst\u0105pienie podczas zjazdu partii politycznej zosta\u0142 zg\u0142oszony w\u00a0zwi\u0105zku z\u00a0szerzeniem nienawi\u015bci wzgl\u0119dem os\u00f3b o\u00a0innym kolorze sk\u00f3ry. Uznali\u015bmy, \u017ce ten film narusza niemieckie prawo i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},{kb:1,type:1,text:"Film przedstawiaj\u0105cy fragmenty film\u00f3w z\u00a0serii \u201eSpongeBob Kanciastoporty\u201d nawi\u0105zuj\u0105ce do II wojny \u015bwiatowej i\u00a0prezentuj\u0105ce symbol swastyki zosta\u0142 zg\u0142oszony w\u00a0zwi\u0105zku z\u00a0propagand\u0105 nazistowsk\u0105. Film ma charakter satyryczny i\u00a0stanowi krytyk\u0119 faszyzmu. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:1,type:1,text:"Otrzymali\u015bmy skargi dotycz\u0105ce kilku film\u00f3w z\u00a0fragmentami nazistowskiej pie\u015bni, kt\u00f3ra jest zakazana w\u00a0Niemczech. Uznali\u015bmy, \u017ce te filmy naruszaj\u0105 niemieckie prawo i\u00a0zablokowali\u015bmy je w\u00a0Niemczech."},{kb:1,type:2,text:"Film prezentuj\u0105cy krytyczne uwagi na temat imigrant\u00f3w oraz islamu, nawi\u0105zuj\u0105cy do samob\u00f3jstwa holenderskiego polityka, kt\u00f3ry krytykowa\u0142 grupy islamskie, zosta\u0142 zg\u0142oszony jako przypadek szerzenia nienawi\u015bci. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:1,type:2,text:"Film przedstawia ewolucj\u0119 logo pewnych znanych dru\u017cyn pi\u0142karskich, mi\u0119dzy innymi Bayernu Monachium z\u00a01945\u00a0roku, zawieraj\u0105cych swastyk\u0119. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:1,type:3,text:"Film przedstawiaj\u0105cy nagrane przem\u00f3wienie Hitlera zosta\u0142 zg\u0142oszony w\u00a0zwi\u0105zku z\u00a0szerzeniem nienawi\u015bci. Film zosta\u0142 przes\u0142any do kana\u0142u po\u015bwi\u0119conego dokumentowaniu historii; tytu\u0142 i\u00a0opis filmu okre\u015bla\u0142y kontekst historyczny. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:1,type:3,text:"Relacja na temat buntu w\u00a0wi\u0119zieniu, przedstawiaj\u0105ca drastyczne sceny, zosta\u0142a zg\u0142oszona w\u00a0zwi\u0105zku z\u00a0prezentowaniem przemocy, znies\u0142awieniem i\u00a0szerzeniem nienawi\u015bci. Film dokumentuje bie\u017c\u0105ce wydarzenia, warte wzmianki w\u00a0mediach. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:1,type:3,text:"Film z\u00a0komentarzem by\u0142ego cz\u0142onka ISIS, w\u00a0kt\u00f3rym odradza on wst\u0119powanie do ISIS, zosta\u0142 zg\u0142oszony jako materia\u0142 zawieraj\u0105cy tre\u015bci terrorystyczne. Na nagraniu widoczna jest flaga ISIS b\u0119d\u0105ca symbolem organizacji uznanej za nielegaln\u0105. Film ma charakter dokumentalny i\u00a0nie zawiera tre\u015bci gloryfikuj\u0105cych dzia\u0142ania ISIS ani ich wspieraj\u0105cych. Nie dopatrzyli\u015bmy si\u0119 w\u00a0nim naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:1,type:4,text:"R\u00f3\u017cne komentarze pod samouczkami po\u015bwi\u0119conymi technikom makija\u017cu zosta\u0142y zg\u0142oszone jako obra\u017aliwe wzgl\u0119dem dziewcz\u0105t i\u00a0kobiet. Uznali\u015bmy, \u017ce te komentarze naruszaj\u0105 niemieckie prawo i\u00a0zablokowali\u015bmy je w\u00a0Niemczech."},{kb:1,type:4,text:"Zosta\u0142 zg\u0142oszony film przedstawiaj\u0105cy profesjonalnego opiekuna zwierz\u0105t, przy czym tytu\u0142 oskar\u017ca\u0142 prezentowan\u0105 osob\u0119 o\u00a0zn\u0119canie si\u0119 nad zwierz\u0119tami. Uznali\u015bmy, \u017ce ten film narusza niemieckie prawo i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},
{kb:1,type:4,text:"Otrzymali\u015bmy skarg\u0119 dotycz\u0105c\u0105 znies\u0142awienia odnosz\u0105c\u0105 si\u0119 do filmu, w\u00a0kt\u00f3rym okre\u015blone osoby zosta\u0142y nazwane pedofilami i\u00a0oskar\u017cone o\u00a0wykorzystywanie dzieci. Uznali\u015bmy, \u017ce ten film narusza niemieckie prawo i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},{kb:1,type:4,text:"Otrzymali\u015bmy od pewnej firmy skarg\u0119 dotycz\u0105c\u0105 znies\u0142awienia, kt\u00f3ra odnosi\u0142a si\u0119 do filmu z\u00a0parodi\u0105 reklamy wideo tej firmy. Parodia mia\u0142a o\u015bmieszy\u0107 firm\u0119 i\u00a0jej pracownik\u00f3w. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:2,type:4,text:"Film komediowy ukazuj\u0105cy r\u00f3\u017cne osoby odpowiadaj\u0105ce na zapytania w\u00a0spos\u00f3b na\u015bladuj\u0105cy dzia\u0142anie wyszukiwarki Google zosta\u0142 zg\u0142oszony jako przypadek szerzenia nienawi\u015bci. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:2,type:4,text:"Film przedstawiaj\u0105cy dziesi\u0119\u0107 najciekawszych moment\u00f3w gry zosta\u0142 zg\u0142oszony jako przypadek zniewa\u017cenia. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:2,type:4,text:"Otrzymali\u015bmy kilka skarg dotycz\u0105cych szerzenia nienawi\u015bci i\u00a0znies\u0142awienia, kt\u00f3re odnosi\u0142y si\u0119 do filmu z\u00a02017\u00a0roku prezentuj\u0105cego spot radiowy na temat Angeli Merkel. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:2,type:4,text:"Film z\u00a0por\u00f3wnaniem r\u00f3\u017cnych platform gier zosta\u0142 zg\u0142oszony jako przypadek szerzenia nienawi\u015bci. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:2,type:1,text:"Otrzymali\u015bmy skarg\u0119 dotycz\u0105c\u0105 zniewa\u017cenia, kt\u00f3ra odnosi\u0142a si\u0119 do teledysku rapowego przedstawiaj\u0105cego zainscenizowane uprowadzenie znanej pary. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},{kb:2,type:1,text:"Otrzymali\u015bmy skarg\u0119 dotycz\u0105c\u0105 szerzenia nienawi\u015bci w\u00a0zwi\u0105zku z\u00a0filmem dokumentuj\u0105cym motywowany politycznie poch\u00f3d z\u00a0pochodniami zorganizowany przez ugrupowania prawicowe. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:2,type:1,text:"Otrzymali\u015bmy skarg\u0119 dotycz\u0105c\u0105 znies\u0142awienia i\u00a0zniewa\u017cenia w\u00a0zwi\u0105zku z\u00a0filmem stanowczo krytykuj\u0105cym pewnego dziennikarza. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},{kb:2,type:1,text:"Reklama wideo przedstawiaj\u0105ca parti\u0119 polityczn\u0105 zosta\u0142a zg\u0142oszona jako materia\u0142 neguj\u0105cy Holokaust. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:2,type:2,text:"Film prezentuj\u0105cy dokument z\u00a0niemieckiej telewizji, kt\u00f3ry opowiada\u0142 o\u00a0gangu motocyklist\u00f3w, zosta\u0142 zg\u0142oszony jako przypadek szerzenia nienawi\u015bci. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:2,type:2,text:"Otrzymali\u015bmy skarg\u0119 dotycz\u0105c\u0105 szerzenia nienawi\u015bci w\u00a0zwi\u0105zku z\u00a0filmem ukazuj\u0105cym osob\u0119 omawiaj\u0105c\u0105 argumenty za aborcj\u0105 oraz przeciw niej. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:2,type:3,text:"Komentarz na temat niemieckiego dow\u00f3dcy z\u00a0czas\u00f3w II\u00a0wojny \u015bwiatowej zosta\u0142 zg\u0142oszony jako przypadek szerzenia nienawi\u015bci. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:2,type:3,text:"Otrzymali\u015bmy skarg\u0119 dotycz\u0105c\u0105 przypadku szerzenia nienawi\u015bci, kt\u00f3ra odnosi\u0142a si\u0119 do filmu omawiaj\u0105cego grupy religijne i\u00a0teorie teologiczne. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:2,type:3,text:"Otrzymali\u015bmy skarg\u0119 dotycz\u0105c\u0105 szerzenia nienawi\u015bci i\u00a0prezentowania nielegalnych symboli, kt\u00f3ra odnosi\u0142a si\u0119 do teledysku krytykuj\u0105cego fikcyjn\u0105 Trzeci\u0105 Rzesz\u0119 jako ustr\u00f3j totalitarny. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:2,type:4,text:"Otrzymali\u015bmy skarg\u0119 dotycz\u0105c\u0105 znies\u0142awienia w\u00a0zwi\u0105zku z\u00a0komentarzem, kt\u00f3ry mia\u0142 zniewa\u017ca\u0107 powoda. Uznali\u015bmy, \u017ce ten komentarz narusza niemieckie prawo i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},
{kb:2,type:4,text:"Komentarz na temat powoda pod gr\u0105 wideo zosta\u0142 zg\u0142oszony jako przypadek zniewa\u017cenia. Uznali\u015bmy, \u017ce kwestionowane tre\u015bci naruszaj\u0105 niemieckie prawo oraz wytyczne dla spo\u0142eczno\u015bci YouTube, i\u00a0usun\u0119li\u015bmy je."},{kb:2,type:4,text:"Otrzymali\u015bmy kilka skarg dotycz\u0105cych znies\u0142awienia w\u00a0zwi\u0105zku z\u00a0filmem prezentuj\u0105cym atak s\u0142owny i\u00a0zniewagi pod adresem religii i\u00a0grup chronionych. Uznali\u015bmy, \u017ce kwestionowane tre\u015bci naruszaj\u0105 niemieckie prawo oraz wytyczne dla spo\u0142eczno\u015bci YouTube, i\u00a0usun\u0119li\u015bmy je."},
{kb:3,type:4,text:"Otrzymali\u015bmy skarg\u0119 dotycz\u0105c\u0105 znies\u0142awienia i\u00a0zniewa\u017cenia w\u00a0zwi\u0105zku z\u00a0teledyskiem rap zawieraj\u0105cym obelgi i\u00a0gro\u017aby skierowane do znanego niemieckiego polityka. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},{kb:3,type:0,text:"Otrzymali\u015bmy od niemieckiego polityka skarg\u0119 o\u00a0znies\u0142awienie w\u00a0zwi\u0105zku z\u00a0filmem, kt\u00f3ry zawiera\u0142 klipy omawiaj\u0105ce niedawne kontrowersje z\u00a0udzia\u0142em tego polityka. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:3,type:4,text:"Otrzymali\u015bmy skarg\u0119 w sprawie filmu, w\u00a0kt\u00f3rym ratownik\u00f3w morskich (Seenotretter) nazwano przemytnikami (\u201eSchlepper\u201d). Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:3,type:3,text:"Otrzymali\u015bmy wiele \u017c\u0105da\u0144 usuni\u0119cia film\u00f3w zwi\u0105zanych z\u00a0napa\u015bci\u0105 z\u00a0u\u017cyciem maczety, do kt\u00f3rej dosz\u0142o w\u00a0Stuttgarcie. Wi\u0119kszo\u015b\u0107 film\u00f3w usun\u0119li\u015bmy ze wzgl\u0119du na naruszenie wytycznych dla spo\u0142eczno\u015bci YouTube zwi\u0105zanych z\u00a0przedstawianiem przemocy. Dost\u0119p do nagra\u0144 o\u00a0naturze informacyjnej i\u00a0dokumentalnej zosta\u0142 ograniczony na podstawie wieku."},
{kb:3,type:2,text:"Otrzymali\u015bmy \u017c\u0105danie usuni\u0119cia filmu nagranego kamer\u0105 noszon\u0105 na ciele przez funkcjonariusza policji. Film pokazuje, jak mo\u017cliwa do rozpoznania osoba zostaje postrzelona w\u00a0trakcie akcji policyjnej i\u00a0otrzymuje niezb\u0119dn\u0105 pomoc medyczn\u0105. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},{kb:4,type:2,text:"Otrzymali\u015bmy od Uniwersytetu pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu przedstawiaj\u0105cego studenta, kt\u00f3ry wydawa\u0142 si\u0119 grozi\u0107, \u017ce wpadnie w\u00a0furi\u0119. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},
{kb:4,type:2,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu, kt\u00f3ry zawiera wywiad z\u00a0osob\u0105 w\u00a0j\u0119zyku arabskim. W\u00a0skardze stwierdzono, \u017ce film promuje organizacj\u0119 zakazan\u0105 w\u00a0Niemczech. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo, i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},{kb:4,type:4,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie komentarza, kt\u00f3ry zamieszczono w\u00a0celu zniewa\u017cenia mo\u017cliwych do zidentyfikowania cz\u0142onk\u00f3w Partii Zielonych poprzez o\u015bmieszenie ich cech fizycznych. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo, i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},
{kb:4,type:4,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie r\u00f3\u017cnych film\u00f3w od firmy prawniczej, kt\u00f3ra twierdzi\u0142a, \u017ce ich tre\u015b\u0107 zniewa\u017ca ich klienta. Film omawia\u0142 teorie spiskowe i\u00a0kulty, w przypadku kt\u00f3rych istnieje domniemanie, \u017ce klient jest w\u00a0nie zaanga\u017cowany. Znale\u017ali\u015bmy pewne adresy URL naruszaj\u0105ce niemieckie prawo i\u00a0zablokowali\u015bmy je w\u00a0Niemczech. W\u00a0przypadku pozosta\u0142ych film\u00f3w brakowa\u0142o nam informacji lub uznali\u015bmy, \u017ce s\u0105 zgodne z prawem."},
{kb:4,type:0,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie 3\u00a0film\u00f3w od dzia\u0142acza politycznego, kt\u00f3ry otwarcie wypowiada si\u0119 przeciwko islamowi. Filmy przedstawiaj\u0105 dyskusje na temat Koranu, a\u00a02\u00a0adresy URL ukazuj\u0105 zachowania antyspo\u0142eczne podejmowane wobec dzia\u0142acza przez cz\u0142onk\u00f3w spo\u0142ecze\u0144stwa. Nie dopatrzyli\u015bmy si\u0119 naruszenia Wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:4,type:3,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu, kt\u00f3ry przedstawia niekonstytucyjne symbole. Film zawiera\u0142 tre\u015bci edukacyjne i\u00a0historyczne. Przywi\u0105zanie przesy\u0142aj\u0105cego do symbolu sugeruje rozumienie jego statusu i\u00a0stanowi\u0142o narracj\u0119 historyczn\u0105 oraz miejsce do dyskusji. Nie dopatrzyli\u015bmy si\u0119 naruszenia Wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:4,type:0,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu ukazuj\u0105cego politycznych ekstremist\u00f3w w\u0142amuj\u0105cych si\u0119 do znanego sklepu powi\u0105zanego ze skrajn\u0105 prawic\u0105 i\u00a0niszcz\u0105cych jego zawarto\u015b\u0107. Materia\u0142 nie zawiera\u0142 bezpo\u015bredniego pod\u017cegania do przest\u0119pstwa. Nie dopatrzyli\u015bmy si\u0119 naruszenia Wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:4,type:2,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu zawieraj\u0105cego symbole nazistowskie, do kt\u00f3rego za\u0142\u0105czono opis z\u00a0wyja\u015bnieniem, \u017ce film jest przeznaczony wy\u0142\u0105cznie do cel\u00f3w komediowych, a\u00a0przesy\u0142aj\u0105cy \u201enie jest nazist\u0105\u201d. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo, i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},{kb:4,type:4,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu ukazuj\u0105cego policjanta, kt\u00f3ry jest wielokrotnie obra\u017cany. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo, i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},
{kb:5,type:2,text:"Otrzymali\u015bmy skargi na film omawiaj\u0105cy zamieszki, kt\u00f3re mia\u0142y miejsce w\u00a0Stuttgarcie po policyjnym dochodzeniu dotycz\u0105cym domniemanego incydentu zwi\u0105zanego z\u00a0narkotykami. Film omawia ten incydent w\u00a0spos\u00f3b przesadny i\u00a0satyryczny. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:5,type:0,text:"Otrzymali\u015bmy skarg\u0119 na przes\u0142any przez kontrowersyjn\u0105 grup\u0119 film s\u0142u\u017c\u0105cy zbieraniu \u015brodk\u00f3w dla znanej partii politycznej. Film zawiera piosenk\u0119 zwi\u0105zan\u0105 z\u00a0tematem migracji do Niemiec. Aby oceni\u0107 zasadno\u015b\u0107 skargi, poprosili\u015bmy autora skargi o\u00a0dodatkowe informacje, ale nie otrzymali\u015bmy odpowiedzi. Nie dopatrzyli\u015bmy si\u0119 zatem naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:5,type:3,text:"Otrzymali\u015bmy skarg\u0119 na film zawieraj\u0105cy materia\u0142 dziennikarski zwi\u0105zany z\u00a0zab\u00f3jstwem prezydenta rejencji Kassel. Film jest reporta\u017cem na temat zab\u00f3jstwa i\u00a0zawiera fragmenty rozmowy policji z\u00a0domniemanym zab\u00f3jc\u0105. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:5,type:2,text:"Otrzymali\u015bmy skarg\u0119 na film przedstawiaj\u0105cy powstanie samozwa\u0144czej milicji do ochrony przed \u201eimigrantami-kryminalistami\u201d w\u00a0Norymberdze. Aktywi\u015bci og\u0142osili powstanie strefy ochrony w\u00a0cz\u0119\u015bci Norymbergi i\u00a0rozdawali Niemkom puszki z\u00a0gazem CS do obrony przed, jak m\u00f3wili, \u201eimportowanymi przest\u0119pcami seksualnymi\u201d. Podczas sprawdzania materia\u0142u pod k\u0105tem \u0142amania niemieckiego prawa stwierdzili\u015bmy, \u017ce film zosta\u0142 ju\u017c usuni\u0119ty za naruszenie wytycznych dla spo\u0142eczno\u015bci YouTube."},
{kb:5,type:0,text:"Otrzymali\u015bmy skarg\u0119 na film niemieckiego YouTubera, kt\u00f3ry popiera kontynuowanie demonstracji w\u00a0Berlinie mimo tego, \u017ce zosta\u0142o to zabronione przez berli\u0144sk\u0105 policj\u0119. Poniewa\u017c S\u0105d Administracyjny w\u00a0Berlinie zni\u00f3s\u0142 zakaz berli\u0144skiej policji, nie stwierdzili\u015bmy naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:5,type:1,text:"Otrzymali\u015bmy skarg\u0119 na film, w\u00a0kt\u00f3rym Antifa nawo\u0142uje do dzia\u0142a\u0144 (r\u00f3wnie\u017c agresywnych) przeciwko nazistom oraz wymienia r\u00f3\u017cne rodzaje mo\u017cliwych dzia\u0142a\u0144. W\u00a0\u015bwietle procesu regulacji wewn\u0119trznej NetzDG przekazali\u015bmy t\u0119 spraw\u0119 instytucji FSM, kt\u00f3ra stwierdzi\u0142a, \u017ce materia\u0142 narusza niemieckie prawo. Zablokowali\u015bmy dost\u0119p do tego filmu w\u00a0Niemczech."},
{kb:5,type:2,text:"Otrzymali\u015bmy skargi na film ze zwiastunem domniemanej gry parodystycznej stworzonej przez kontrowersyjn\u0105 organizacj\u0119. Zwiastun uderza\u0142 w\u00a0okre\u015blone grupy chronione oraz osoby publiczne. Ustalili\u015bmy, \u017ce ten materia\u0142 narusza\u0142 wytyczne dla spo\u0142eczno\u015bci YouTube. Za naruszenie wytycznych dla spo\u0142eczno\u015bci YouTube usun\u0119li\u015bmy te\u017c powi\u0105zany kana\u0142."},{kb:5,type:1,text:"Otrzymali\u015bmy skarg\u0119 na film dokumentuj\u0105cy demonstracj\u0119 polityczn\u0105 i\u00a0interakcje mi\u0119dzy protestuj\u0105cymi a\u00a0policj\u0105. Film pokazuje, jak mo\u017cliwa do rozpoznania osoba le\u017cy nieprzytomna na ziemi. Jest otoczona przez policj\u0119, a\u00a0jeden z\u00a0policjant\u00f3w udziela jej pomocy medycznej. Zgodnie z procedur\u0105 regulowania wewn\u0119trznego opisan\u0105 w ustawie NetzDG przekazali\u015bmy t\u0119 spraw\u0119 instytucji FSM, kt\u00f3ra nie stwierdzi\u0142a naruszenia niemieckiego prawa."},
{kb:6,type:4,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu sugeruj\u0105cego, \u017ce wysoko postawiony polityk jest przeciwko zakazowi pedofilii i\u00a0popiera legalizacj\u0119 seksu z\u00a0dzie\u0107mi. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo, i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},{kb:6,type:4,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie komentarza sugeruj\u0105cego, \u017ce policjanci s\u0105 nazistami. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo, i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},
{kb:6,type:4,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie komentarza obra\u017caj\u0105cego zmar\u0142ego polityka i\u00a0zawieraj\u0105cego stwierdzenie, \u017ce dosta\u0142 on to, na co zas\u0142u\u017cy\u0142. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo, i\u00a0zablokowali\u015bmy go."},{kb:6,type:2,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu, kt\u00f3ry pokazywa\u0142 fragment brutalnej sceny z\u00a0filmu bez \u017cadnego kontekstu i\u00a0z\u00a0jednoznacznym zamiarem zaszokowania widz\u00f3w. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo, i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},
{kb:6,type:0,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie kr\u00f3tkiego filmu, w\u00a0kt\u00f3rym komik przedstawia swoje opinie i\u00a0krytykuje cz\u0142onk\u00f3w partii AfD. Ze wzgl\u0119du na komediowe intencje i\u00a0interes publiczny nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:6,type:0,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu por\u00f3wnuj\u0105cego uczestnik\u00f3w protest\u00f3w zwi\u0105zanych z\u00a0COVID-19 do nazist\u00f3w w\u00a0satyryczny, komediowy spos\u00f3b. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},
{kb:6,type:1,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie 2\u00a0film\u00f3w przedstawiaj\u0105cych postrzelenie obywatela USA przez policj\u0119 w\u00a0hotelu. Materia\u0142 zosta\u0142 przes\u0142any m.in. przez ameryka\u0144skie \u017ar\u00f3d\u0142o wiadomo\u015bci. Po przekazaniu pro\u015bby o\u00a0usuni\u0119cie do zewn\u0119trznego radcy prawnego uznali\u015bmy, \u017ce filmy naruszaj\u0105 niemieckie prawo, i\u00a0zablokowali\u015bmy je w\u00a0Niemczech."},{kb:6,type:2,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie kr\u00f3tkiego filmu sugeruj\u0105cego, \u017ce cudzoziemcy szkodz\u0105 niemieckiemu pa\u0144stwu, a\u00a0Niemcy powinni wzi\u0105\u0107 sprawy we w\u0142asne r\u0119ce i\u00a0wyeliminowa\u0107 imigrant\u00f3w. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo, i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},
{kb:7,type:0,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu zawieraj\u0105cego materia\u0142 z\u00a0lat\u00a030. XX wieku, kt\u00f3ry zosta\u0142 wyprodukowany w\u00a0ramach propagandy nazistowskiej. Obecnie ten materia\u0142 to wersja z\u00a0ocen\u0105 FSK (instytucji regulowania wewn\u0119trznego na potrzeby film\u00f3w). Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani niemieckiego prawa."},{kb:7,type:0,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie teledysku przedstawiaj\u0105cego niemiecki utw\u00f3r marszowy cz\u0119sto wykonywany w\u00a0czasach nazistowskich, a\u00a0tak\u017ce p\u00f3\u017aniej. Dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube i\u00a0usun\u0119li\u015bmy ten film globalnie. Nie dopatrzyli\u015bmy si\u0119 naruszenia niemieckiego prawa."},
{kb:7,type:0,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu zawieraj\u0105cego wskaz\u00f3wki, jak oszuka\u0107 test na obecno\u015b\u0107 narkotyk\u00f3w. Nie dopatrzyli\u015bmy si\u0119 naruszenia niemieckiego prawa, ale usun\u0119li\u015bmy ten film globalnie z\u00a0powodu naruszenia wytycznych dla spo\u0142eczno\u015bci."},{kb:7,type:4,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie niemieckiego materia\u0142u informacyjnego zawieraj\u0105cego nieprawdziw\u0105 informacj\u0119 o\u00a0\u015bmierci celebryty. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo, i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},
{kb:7,type:4,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu zawieraj\u0105cego wysoce obra\u017aliwe tre\u015bci wobec pracownik\u00f3w pewnego banku. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo, i\u00a0zablokowali\u015bmy go w\u00a0Niemczech."},{kb:7,type:4,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie komentarza zawieraj\u0105cego stwierdzenie, \u017ce niemiecki rz\u0105d zleci\u0142 zab\u00f3jstwo cz\u0142onka mniejszej partii politycznej. Opublikowane w\u00a0prasie o\u015bwiadczenie prokuratury pozwala ustali\u0107 faktyczny przebieg zdarze\u0144. Uznali\u015bmy, \u017ce ten materia\u0142 narusza niemieckie prawo, i\u00a0usun\u0119li\u015bmy go."},
{kb:7,type:1,text:'Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie komentarza zawieraj\u0105cego stwierdzenie, \u017ce cz\u0142onkowie CDU (partii politycznej) torturowali i\u00a0zabili 50\u00a0tys. os\u00f3b w\u00a0Niemczech. Komentarz odnosi si\u0119 do filmu przedstawiaj\u0105cego kampani\u0119 wyborcz\u0105 z\u00a01957\u00a0roku. Wys\u0142ali\u015bmy zg\u0142oszenie w\u00a0ramach procedury regulowania wewn\u0119trznego do stowarzyszenia FSM (zajmuj\u0105cego si\u0119 regulowaniem wewn\u0119trznym na potrzeby multimedi\u00f3w), kt\u00f3re uzna\u0142o te tre\u015bci za zgodne z\u00a0prawem. Z\u00a0decyzj\u0105 podj\u0119t\u0105 przez FSM mo\u017cna zapozna\u0107 si\u0119 <a href="https://www.fsm.de/sites/default/files/netzdg0552021_voe.pdf" target="_blank">tutaj</a>.'},
{kb:7,type:3,text:"Otrzymali\u015bmy pro\u015bb\u0119 o\u00a0usuni\u0119cie filmu nakr\u0119conego kamer\u0105 noszon\u0105 na mundurze przez funkcjonariusza policji, kt\u00f3ry postrzeli\u0142 cz\u0142owieka. Film zosta\u0142 przes\u0142any przez ameryka\u0144ski serwis informacyjny. Okaza\u0142o si\u0119 p\u00f3\u017aniej, \u017ce zmar\u0142y mia\u0142 bro\u0144 pneumatyczn\u0105. Materia\u0142 ten zosta\u0142 wyemitowany przez organy \u015bcigania po uznaniu funkcjonariusza za niewinnego. Nie dopatrzyli\u015bmy si\u0119 naruszenia wytycznych dla spo\u0142eczno\u015bci YouTube ani sekcji\u00a01 paragraf\u00a03 ustawy NetzDG. Zablokowali\u015bmy jednak dost\u0119p do filmu lokalnie z\u00a0powodu naruszenia innego lokalnego prawa."}];
