this.KJa='Ustawa o\u00a0egzekwowaniu prawa w\u00a0sieci (NetzDG) zacz\u0119\u0142a obowi\u0105zywa\u0107 w\u00a0Niemczech 1\u00a0pa\u017adziernika 2017\u00a0roku. Ustawa nak\u0142ada na sieci spo\u0142eczno\u015bciowe wym\u00f3g wprowadzenia skutecznej i\u00a0transparentnej metody obs\u0142ugi skarg dotycz\u0105cych tre\u015bci niezgodnych z\u00a0prawem w\u00a0spos\u00f3b opisany w\u00a0NetzDG. Poza tym zobowi\u0105zuje takie sieci do publikowania raport\u00f3w przejrzysto\u015bci co 2\u00a0lata. Taki raport musi zawiera\u0107 dane na temat organizacji i\u00a0przyj\u0119tych procedur oraz ilo\u015bci otrzymanych skarg i\u00a0usuni\u0119tych tre\u015bci. Musi zawiera\u0107 te\u017c og\u00f3lne informacje o\u00a0naszych praktykach i\u00a0zasadach w\u00a0zakresie usuwania tre\u015bci.<br/><br/><p class="highlight-text"><strong>Poprawka dotycz\u0105ca okresu raportowania od stycznia do czerwca 2021\u00a0r.</strong><br/>Raport obejmuj\u0105cy okres od stycznia do czerwca 2021\u00a0r. zawiera\u0142 informacje i\u00a0dane dotycz\u0105ce paragrafu 189\u00a0niemieckiego kodeksu karnego (zniewa\u017cenie pami\u0119ci zmar\u0142ych), mimo \u017ce powinny by\u0107 one cz\u0119\u015bci\u0105 raportu NetzDG sporz\u0105dzanego od lipca 2022\u00a0r. Raport dotycz\u0105cy YouTube opublikowany w\u00a0lipcu 2021\u00a0r. zawiera\u0142 wi\u0119c informacje i\u00a0dane, kt\u00f3re zgodnie z\u00a0ustaw\u0105 NetzDG nie by\u0142y obj\u0119te wtedy (ani teraz) obowi\u0105zkiem raportowania. Dane wymienione w\u00a0raporcie w\u00a0odniesieniu do paragrafu 189\u00a0niemieckiego kodeksu karnego (StGB) zosta\u0142y zebrane w\u00a0okresie od stycznia do czerwca 2021\u00a0r. i\u00a0pojawi\u0142y si\u0119 w\u00a0kategorii \u201eZnies\u0142awianie lub zniewa\u017canie\u201d. Obecnie wprowadzamy poprawki w\u00a0bie\u017c\u0105cym raporcie, zaczynaj\u0105c od usuni\u0119cia wszystkich wzmianek dotycz\u0105cych paragrafu 189\u00a0StGB. Opublikujemy je ponownie w\u00a0lipcu 2022\u00a0r., gdy informacje te b\u0119d\u0105 podlega\u0107 raportowaniu. Na odpowiednim wykresie w\u00a0tym raporcie zaznaczyli\u015bmy, jak du\u017co tre\u015bci naruszaj\u0105cych paragraf 189\u00a0StGB usun\u0119li\u015bmy w\u00a0poprzednim i\u00a0obecnym okresie raportowania. Nie mo\u017cemy poda\u0107 konkretnych warto\u015bci, poniewa\u017c raportowane tre\u015bci musz\u0105 by\u0107 przechowywane maksymalnie przez okres 10\u00a0tygodni po usuni\u0119ciu na wypadek, gdyby by\u0142y potrzebne jako materia\u0142 dowodowy zgodnie z\u00a0paragrafem 3\u00a0(2) nr\u00a04\u00a0ustawy NetzDG.</p>';
